import axios from "axios";
require('dotenv').config()

const uri = `http://${process.env.REACT_APP_PRIVATE_IP}:8080/api`;
console.log("url : " + uri);

export default axios.create({
  baseURL: uri,
  headers: {
    "Content-type": "application/json"
  }
});
